import { Col, Container, Row, Tab, Nav } from "react-bootstrap";
import { ProjectCard } from "./ProjectCard";
import colorSharp2 from "../assets/img/color-sharp2.png";
import projImg1 from "../assets/img/project-img1.png";
import projImg2 from "../assets/img/project-img2.png";
import projImg3 from "../assets/img/project-img3.png";
import myImage from "../assets/img/projMasc.png";

export const Projects = () => {

    const projects = [
        {
            title: "meriam.id",
            description: "GSM Design for FnB UMKM",
            imgUrl: projImg1,
        },
        {
            title: "Anspro",
            description: "GSM Design for Cosmetic UMKM",
            imgUrl: projImg2,
        },
    ];

    return (
        <section className="project" id="project">
            <Container>
            <div style={{ position: 'relative' }}>
                <img 
                    src={myImage} 
                    alt="Description" 
                    style={{ 
                    position: 'absolute', 
                    top: '10%', 
                    left: '10%', 
                    transform: 'translate(-50%, -50%)' 
                    }} 
                />
            </div>
                <Row>
                    <Col>
                        <h2></h2>
                        <Tab.Container id="projects-tabs" defaultActiveKey="first">
                        <Nav variant="pills" className="nav-pills mb-5 justify-content-center align-items-center" id="pills-tab">
                            <Nav.Item>
                                <Nav.Link eventKey="first">Alpha Visual</Nav.Link>
                            </Nav.Item>
                            <Nav.Item>
                                <Nav.Link eventKey="sec">Alpha Video</Nav.Link>
                            </Nav.Item>
                            <Nav.Item>
                                <Nav.Link eventKey="third">Alpha AdVance</Nav.Link>
                            </Nav.Item>
                        </Nav>
                        <Tab.Content>
                            <Tab.Pane eventKey="first">
                                <Row>
                                    {
                                        projects.map((project, index) => {
                                            return(
                                                <ProjectCard
                                                 key={index}
                                                 {...project}
                                                />
                                            )                                    
                                        })
                                    }
                                </Row>
                            </Tab.Pane>
                            <Tab.Pane eventKey="second">Lorem Ipsum</Tab.Pane>
                            <Tab.Pane eventKey="third">Lorem Ipsum</Tab.Pane>
                        </Tab.Content>
                        </Tab.Container>
                    </Col>
                </Row>
            </Container>
            <img className="background-image-right" src={''}></img>
        </section>
    )
}
